import React from "react";
import { takeRandomUnit } from "./units/Units";

const App: React.FC = () => {
  const rederGameBoard = (): any => {
    for (let i = 0; i < 12; ++i) {
      takeRandomUnit()
      return (
        <div className="cell">
          <button>
            <div> HP {takeRandomUnit()._HP}</div>
            <img src/>
          </button>
        </div>
      );
    }
  };
  return (
    <div className="app">
      <button>
        <img src={takeRandomUnit()._imgPath} />
      </button>
    </div>
  );
};

export default App;
